pragma solidity ^0.8.0;

contract DoubtsResolve {

    uint count;

    event CountVal(uint count, string where);

    modifier testMod {
        require(true);
        _;
        count++;
        emit CountVal(count, "Modifier");
        _;
        count++;
        emit CountVal(count, "Modifier");
    }

    function test() external testMod {

        uint i = 0;

        while (i < 1000) {
            i++;
        }

        count++;
        emit CountVal(count, "Function");
    }
}
